import { CREATE } from '../constants/actionTypes.js';

const reducersUsers = (users = [], action) => {
    switch (action.type) {
        case CREATE:
            return [...posts, action.payload];
        default: // TODO: fix default action
            return action.payload;
    }
};

export default reducersUsers;
